import React from 'react';
import '../App.css';
import data from "../data/data"




class TransactionsContainer extends React.Component {
  constructor(props) {
    super(props);

  }

  transactions: data.Transactions;
  render() {
    return (
      <div>
        Transactions here
         <ul>
                {this.transactions.map(s => (<li>{s}</li>))}
            </ul>
      </div>
    );
  }
}

export default TransactionsContainer;
